import './TeamMember.css';

function TeamMember({name, image, description}) {

    return (
        <div className="team-member">
                <div className="team-member-details">
                    <h3>{name}</h3>
                    <p>123-456-7890</p>
                    <p>webapps@fit.edu</p>
                    <p>{description}</p>
                </div>
                <img src={image} alt={name} />
                <h3>{name}</h3>
        </div>
    );
}

export default TeamMember;
